import express from "express";
import { banksLogo } from "./bankLogos";

const { v4: uuidv4 } = require("uuid");

const app = express();
app.use(express.json());
app.listen(3333);

const accounts = [];

// Middleware
function accountAlreadyExists(request, response, next) {
  const { id } = request.headers;
  const account = accounts.find((account) => account.id === id);

  if (!account) {
    return response.status(404).send({ error: "account not found" });
  }

  request.account = account;

  return next();
}

function getBalance(statement) {
  const balance = statement.reduce((acc, operation) => {
    if (operation.type == "credit") {
      return acc + operation.amount;
    } else {
      return acc - operation.amount;
    }
  }, 0);

  return balance;
}

// Routes

// Criar uma conta
app.post("/account", (request, response) => {
  const { name } = request.body;

  const accountAlreadyExists = accounts.some(
    (account) => account?.lowerName === name.toLowerCase()
  );

  if (accountAlreadyExists) {
    return response.status(400).send({ error: "Account already exists" });
  }

  const lowerName = name.toLowerCase();

  accounts.push({
    id: uuidv4(),
    lowerName,
    statement: [],
  });

  return response.status(201).send();
});

// Verificar o extrato de uma conta
app.get("/statement/", accountAlreadyExists, (request, response) => {
  const { account } = request;

  return response.json(account.statement);
});

// Registra um depósito no extrato de uma conta
app.post("/deposit/", accountAlreadyExists, (request, response) => {
  const { description, amount } = request.body;

  const { account } = request;

  const statementOperation = {
    description,
    amount,
    created_at: new Date(),
    type: "credit",
  };

  account.statement.push(statementOperation);

  return response.status(201).send();
});

// Registra um saque no extrato do conta
app.post("/withdraw/", accountAlreadyExists, (request, response) => {
  const { amount, description } = request.body;
  const { account } = request;

  const balance = getBalance(account.statement);

  if (balance < amount) {
    return response.status(400).send({ error: "Insufficient funds" });
  }

  const statementOperation = {
    description,
    amount,
    created_at: new Date(),
    type: "debit",
  };

  account.statement.push(statementOperation);

  return response.status(201).send();
});

// Pesquisar registros em uma data no extrato
app.get("/statement/date", accountAlreadyExists, (request, response) => {
  const { account } = request;
  const { date } = request.query;

  const dateFormat = new Date(date + " 00:00");

  const statement = account.statement.filter(
    (statement) =>
      statement.created_at.toDateString() ===
      new Date(dateFormat).toDateString()
  );

  return response.json(statement);
});

// Alterar uma conta
app.put("/account", accountAlreadyExists, (request, response) => {
  const { name } = request.body;
  const { account } = request;

  account.name = name;

  return response.status(201).send();
});

// Retornar uma conta
app.get("/account", accountAlreadyExists, (request, response) => {
  const { account } = request;

  return response.json(account);
});

app.get("/accounts", (request, response) => {
  return response.json(accounts);
});

// Deletar uma conta
app.delete("/account", accountAlreadyExists, (request, response) => {
  const { account } = request;

  accounts.splice(accounts.indexOf(account), 1);

  return response.status(200).json(accounts);
});

// Verficar valor em conta de uma conta
app.get("/balance", accountAlreadyExists, (request, response) => {
  const { account } = request;

  const balance = getBalance(account.statement);

  return response.json(balance);
});

// Retorna valor total (somando o balanço de todas as contas)
app.get("/balance-all", (request, response) => {
  const balances = accounts.map((account) => getBalance(account.statement));
  let sum = balances.reduce((acc, balance) => {
    return acc + balance;
  });

  return response.json(sum);
});

